// frontend/src/components/WeatherAlertCard.jsx
import React from 'react';
import './Card.css';

const WeatherAlertCard = ({ data, onUpdate, onSend, readyState }) => {
  const handleSubmit = (e) => {
    e.preventDefault();
    if (onSend) {
      onSend();
    }
  };

  return (
    <div className="card">
      <h2 className="card__title">Weather Alert</h2>
      <form className="form" onSubmit={handleSubmit}>
        <label>
          <span>Location</span>
          <input type="text" name="location" value={data.location} onChange={onUpdate} />
        </label>
        <label>
          <span>Alert Type</span>
          <input type="text" name="alert_type" value={data.alert_type} onChange={onUpdate} />
        </label>
        <label>
          <span>Severity</span>
          <input type="number" name="severity" value={data.severity} onChange={onUpdate} />
        </label>
        <select>
          <option value="heavy_rain">Heavy Rain</option>
          <option value="strong_wind">Strong Wind</option>
        </select>
        <button type="submit" className="btn" disabled={readyState !== 'open'}>Send</button>
      </form>
    </div>
  );
};

export default WeatherAlertCard;
